function Card(props) {
    const {img, text} = props;
    return(
        <Card className="card">
            <Card.Img className="cardImg" variant="top" src={img} />
                <Card.Body>
                    <Card.Text>
                        {text}
                    </Card.Text>
                </Card.Body>
        </Card>
    )
}

export default Card;
